import logo from './logo.svg';
import './App.css';



function Card() {
  return (
      <div class="row justify-content-sm-center">
        <div class="col-4">
          <div class="card text-center survey-card">
            <div class="card-body">
              BearBaking Cookie Survey.
            </div>
          </div>
        </div>
      </div>
  )
}



